class App extends React.Component{

  constructor(){
     super();
     this.state = {value: ''}
  }
  
  unCheck(i){
     let ref = 'ref_' + i;
     this.refs[ref].checked = !this.refs[ref].checked;
  }
  
  render(){
    return (
      <div>
       {[1,2,3,4,5].map((item,i) => {
          return (
             
                <div className = 'box'>

<input type="checkbox" checked={true} ref={'ref_' + i}/>
 <button onClick={()=>this.unCheck(i)}>Toggle</button>

<td className = 'a'>{this.props.obj.d_sku}</td>

<td className = 'a'>{this.props.obj.d_name}</td>

<td className = 'a'>{this.props.obj.d_price + "$"}</td>

<td className = 'a'>{this.props.obj.d_attribute}</td>
</div>  
                
           )
       })}      
      </div>
    )
  }

}
